// RestaurantPage.js

import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
//import './RestaurantPage.css'; // Archivo de estilos específicos de la página

function RestaurantPage() {
  return (
    <div className="RestaurantPage">
      <header className="bg-dark text-white">
        <div className="container">
          <h1>Nombre del Restaurante</h1>
          {/* Opciones de navegación, logotipo, etc. */}
        </div>
      </header>

      <main className="container mt-4">
        <section>
          <div className="row">
            <div className="col-md-6">
              {/* Contenido de la primera columna */}
            </div>
            <div className="col-md-6">
              {/* Contenido de la segunda columna */}
            </div>
          </div>
          <div className="menu-item">
                <h3>Platillo 1</h3>
                <p>Descripción del platillo.</p>
                <p>Precio: $X</p>
                <img src="ruta-de-la-imagen-1.jpg" alt="Platillo 1" />
              </div>
        </section>

        <section>
          <div className="row">
            <div className="col-md-6">
              {/* Contenido de la primera columna */}
            </div>
            <div className="col-md-6">
              {/* Contenido de la segunda columna */}
            </div>
          </div>
        </section>
      </main>

      <footer className="bg-dark text-white text-center py-3">
        <p>Dirección - Teléfono - Horario</p>
      </footer>
    </div>
  );
}

export default RestaurantPage;
